import React from 'react'
import {Link} from 'react-router-dom';
import './Header.scss';

export default function Header(props) {
    return (
        <div className="row">
            <div className="col">
                <nav className="navbar navbar-expand fixed-top navbar-dark bg-dark">
                    <h1 className="navbar-brand" >Someone</h1>
                    <div className="navbar-nav" id="navBarContent">
                        {props.children.map(child=><Link className="nav-item nav-link" to={`/${child.route}`} >{child.title}</Link>)}
                    </div>
                </nav>
            </div>
        </div>

    )

}
